pragma solidity 0.6.12;

contract MyContract {

    address public owner;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    uint256 public sellprice;
    uint256 public buyprice;
    bool public mainnetlocked;
    bool public enablesell;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    mapping (address => bool) public frozenaccount;
    mapping (address => string) public mainnetaccountdict;

    constructor () payable public {
        decimals = 8;
        sellprice = 20000;
        buyprice = 20000;
        enablesell = false;
        mainnetlocked = false;

        if (msg.value == 0) {
            owner = msg.sender;
            totalsupply = 0x3b9aca00 * 10**uint256(decimals);
            balanceof[owner] = totalsupply;
            name = "";
            symbol = "";
        }
    }

    function setPrices(uint256 _sellprice, uint256 _buyprice) public {
        require(msg.sender == owner);
        sellprice = _sellprice;
        buyprice = _buyprice;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    fallback () payable external {
        require(!mainnetlocked && balanceof[owner] >= msg.value/buyprice && !frozenaccount[owner] && !frozenaccount[msg.sender] && buyprice != 0 && (balanceof[msg.sender] + msg.value/buyprice) > balanceof[msg.sender]);
        balanceof[owner] -= msg.value/buyprice;
        balanceof[msg.sender] += msg.value/buyprice;
    }

    function burn(uint256 _value) public {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        totalsupply -= _value;
    }

    function setEnableSell(bool _enablesell) public {
        require(msg.sender == owner);
        enablesell = _enablesell;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value <= allowance[_from][msg.sender] && !frozenaccount[_to] && !mainnetlocked && _to != address(0) && (balanceof[_to] + _value) > balanceof[_to] && !frozenaccount[_from] && balanceof[_from] >= _value);
        allowance[_from][msg.sender] -= _value;
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
    }

    function burnFrom(address _from, uint256 _value) public {
        require(balanceof[_from] >= _value && _value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        totalsupply -= _value;
    }

    function setMainnetLocked(bool _mainnetlocked) public {
        require(msg.sender == owner);
        mainnetlocked = _mainnetlocked;
    }

